  `logo` varchar(255) NOT NULL DEFAULT '' COMMENT 'logo图',
  `background` varchar(255) NOT NULL DEFAULT '' COMMENT '活动背景图',
  `config` text COMMENT '配置信息',
  `support` varchar(255) NOT NULL DEFAULT '' COMMENT '赞助支持',
